import React from 'react'
import {AppBar, Drawer, Grid, IconButton, Toolbar, Typography } from '@material-ui/core'
import { Menu } from '@material-ui/icons'
import { makeStyles } from '@material-ui/styles'
import SettingsMenu from '../_menus/setingsMenu'

const styles = makeStyles({
    icon:{
        color: 'white'
    },
    settings:{
        display: 'flex',
        justifyContent: 'flex-end'
    }
})
interface IProps{
    title: string
}

const HeaderBar: React.FC<IProps> = (props) =>{

    const {title} = props
    const useStyle = styles()

    return(
        <AppBar color='primary' position='sticky'>
            <Toolbar>
                <Grid item xs = {4}>
                {/* <IconButton onClick = {handleShowMenu}>
                    <Menu className={useStyle.icon} />
                </IconButton> */}
                </Grid>
                <Grid item xs = {4}>
                    <Typography variant='h6'>{title}</Typography>
                </Grid>
                {/* <Grid 
                    className={useStyle.settings}
                    item xs = {4}> */}
                        <SettingsMenu/>
                {/* </Grid> */}
            </Toolbar>
        </AppBar>
    )
}

export default HeaderBar
